import './App.css';

const user = {
  name: "Seema",
  lastName: "Verma"
}

const navColor = {
  backgroundColor: '#e3f2fd',
};

function App() {
  const element = {
    tyle: 'h1',
    props: {
      children: 'Testing'
    }
  }
  // how to use createElement 
  // const ele = React.createElement(element.type, element.props)
  // return ele;

  // JSX code
  return (
    // adding styling and bootstrap
    <div className="blank">
      <nav class="navbar navbar-expand-lg navbar-light" style={navColor}>
      <a class="navbar-brand" href="#">React Practice</a>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarColor03" aria-controls="navbarColor03" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>

      <div class="collapse navbar-collapse" id="navbarColor03">
        <ul class="navbar-nav mr-auto">
          <li class="nav-item active">
            <a class="nav-link" href="#">Home</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Features</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Pricing</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">About</a>
          </li>
        </ul>
      </div>
      </nav>

      {/* adding comments in jsx and using props */}
      {/* <div>{element}</div> */}
    </div>
  );
}

export default App;

